TITLE:
  - Simulation of biaxial mechanical loading of AAA wall.
  - 1) The values for k1 and k2 of the collagen model are fitted to approximate
  - 'the 4-fiber family model reported in [4]. So we have one fiber family'
  - with bingham distribution compared to 4-fiber families without dispersion
  - 'in [4]. The fitted quantities are the axial stress (here y-direction)'
  - and circumferential stress (here x-direction).
  - '2) We use a Bingham distribution of the kind proposed in [3]. Note,'
  - that the azimuthal and elevation angles are defined differently in
  - '[3]. This is important for the definition of the integration over'
  - 'a spherical surface (see [5]). Therefore, also our values for the'
  - constants of the Bingham distribution are different from those reported
  - 'in [3].'
  - 'Our direction vector is:'
  - m = sin(theta)*cos(phi) e1 + sin(theta)*sin(phi) e2 + cos(theta) e3
  - '3) We use a Neo-Hookean material for the ground matrix. In [4] another'
  - strain energy function was used with a very low stiffness. The strain
  - 'energy function in [4] is similar to our coup1pow material with an exponent'
  - of D=1 which is not allowed since such a material is not stress free in
  - the initial configuration.
  - 'Units: kg, m, s'
  - Wall with thickness 1.6cm and side lengths 12.0cm is loaded biaxially
  - by prescribed Dirichlet. The final stretch in x- and y-direction is 1.11
  - The xy-plane is the tangential plane to the AAA. The z-axis points in
  - thickness direction of the wall.
  - 'Using von Bingham distribution with constants:'
  - C1 13.25 C2 10.3 C3 0.0 C4 6.61303987e+05
  - 'yields structural tensor:'
  - 'Matrix<6,1>[0.759909 0.202967 0.0371241 0 0 0]'
  - '[1] Holzapfel G.A., Gasser T.C., Ogden R.W.; A new constitutive framework'
  - for arterial wall mechanics and a comparative study of material models.
  - '[2] Nolan D.R., Gower A.L., Destrade M., Ogden R.W., McGarry J.P.;'
  - A robust anisotropic hyperelastic formulation for the modelling of
  - soft tissue.
  - '[3] Gasser T.C. et al.; Spatial orientation of collagen fibers in the'
  - abdominal aortic aneurysm's wall and its relation to wall mechanics.
  - '[4] Ferruzzi J. et al.; On constitutive descriptors of the biaxial'
  - mechanical behaviour of human abdominal aorta and aneurysms.
  - '[5] Atkinson K.; Numerical Integration on the sphere.'
